import React, { Component, useState } from 'react';
import { Button, Typography, Menu, MenuItem } from '@material-ui/core';
import Dropdown from 'muicss/lib/react/dropdown';
import DropdownItem from 'muicss/lib/react/dropdown-item';
import './navbar.css';

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isOpen: true,
    };
  }

  handleClick() {
    this.setState({isOpen: true});
  }

  handleClose() {
    this.setState({isOpen: false});
  }

  navigateTo(page) {
    window.location.href = page;
  }

  // if i get desperate and want to use bootstrap: https://stackoverflow.com/questions/43493678/react-bootstrap-import-navbar-module

  render() {
    return (
      <div id="navbar-container">
        <div id="navbar-title-container">
          <Typography id="navbar-title" variant="h2">
            NATALIE WAGNER
          </Typography>
        </div>
        <div id="navbar-buttons-container">
          <Button color="inherit" onClick={() => this.navigateTo('index.html')}
            onMouseEnter={() => console.log('enter home')}
            onMouseLeave={() => console.log('exit home')}>
            Home
          </Button>
          {/* <Button color="inherit" onClick={() => this.navigateTo('quiz.html')}>
            Quiz
          </Button> */}
          <Button color="inherit" onClick={() => this.navigateTo('links.html')}>
            My Links
          </Button>
          <Button color="inherit" onClick={() => this.navigateTo('emailnatalie.html')}>
            Email Me
          </Button>

          <Dropdown
            open={this.state.isOpen}
            // onClick={() => this.handleClick()}
            // onMouseEnter={() => this.handleClick()}
            onMouseEnter={() => document.getElementById("idofthiselement").click()}
            onMouseLeave={() => this.handleClose()}
            // onClick={() => console.log('clicked!')}
            // onMouseEnter={() => console.log('enter!')}
            // onMouseLeave={() => console.log('exit!')}
            color="inherit" style={{display:'inline', borderWidth:'0px'}} label="LINKS" className="MuiButtonBase-root MuiButton-root MuiButton-text MuiButton-colorInherit">
            <DropdownItem style={{backgroundColor:'indianred'}} link="links.html">My Links</DropdownItem>
            <DropdownItem style={{backgroundColor:'indianred'}} link="links.html">BLM Links</DropdownItem>
          </Dropdown>


          {/* <div>
            <ul className="mui-dropdown__menu mui--is-open" style={{top: '39.5px'}}>
              <li style={{backgroundColor: 'indianred'}}>
                <a href="links.html">My Links</a>
              </li>
              <li style={{backgroundColor: 'indianred'}}>
                <a href="links.html">BLM Links</a>
              </li>
            </ul>
          </div> */}

          {/* <div onMouseEnter={() => console.log('hey')} style={{display:'inline'}}>
            <Button color="inherit" onClick={() => this.navigateTo('links.html')}>
              My Links
            </Button>
          </div>
          <div>
            hey
          </div> */}
        </div>
        {/* <div id="navbar-secondary-buttons-container">
          <Button color="inherit" onClick={() => this.navigateTo('links.html')}>
            My Links
          </Button>
        </div> */}
      </div>
    );
  }
}

export default Navbar;
